import React from 'react'
import Inicio from './Plantilla';
import './../App.css';


function Eventos() {
  return (
    <div>
      <Inicio>
      <div class="carousel">
        <div class="slide">Slide 1</div>
        <div class="slide">Slide 2</div>
        <div class="slide">Slide 3</div>
      </div>

      </Inicio>
    </div>
  )
}

export default Eventos
